    public PathInfo getPath(String start, String end){
        //The bug is occured from here, with be fixed when the information is filled in

        int index=-1;

        for(int i=0;i<Pathlist.size();i++){
            if(start.equals(Pathlist.get(i).getStart()) && end.equals(Pathlist.get(i).getEnd())){
                index = i;
                break;
            }
        }
        return Pathlist.get(index);
    }

